import { Outlet } from 'react-router-dom'

export default function mainhome() {
  return (
    <div className='main'>
    
        <div className='sub1'>
            <Leftlogos />
        </div>

        <div className='sub2'>
            <Outlet/>
        </div>
  </div>
  )
}
